function getWord(dificult) {
    var selectedDificultWords = [];

    // alert(dificult)
    dificult = dificultProperties[dificult];
    // alert(JSON.stringify(dificult));

    for (var i = 0; i < listOfWords.length; i++) {
        if (listOfWords[i].word.length >= dificult.min && listOfWords[i].word.length <= dificult.max) {
            selectedDificultWords.push(listOfWords[i]);
        }
    }

    var randomWord = selectedDificultWords[random(selectedDificultWords.length)];

    console.log(randomWord.word);

    word.word = randomWord.word;
    word.url_word_sound = URL_WORDS_SOUNDS.replace("#", randomWord.word);
    setSoundDescription(randomWord.description_times, URL_WORDS_DESCRIPTION_SOUNDS.replace("#", randomWord.word));
    word.description.description_times = randomWord.description_times;
    word.url_image = getImage(word.word);

    // return JSON.stringify(word);
    return word;
}

function setSoundDescription(numberOfTime, descriptionUrl) {
    for (var i = 0; i < numberOfTime; i++) {
        word.description.description_url_list.push(
            descriptionUrl.replace("$", i+1)
        );
    }
}

function getImage(word) {
    var url = URL_IMAGES.replace("#", word);
    var response = JSON.parse(getUrl(url));

    try {
        response = response.hits[random(response.hits.length)].largeImageURL;
    } catch (e) {
        console.log(e);
        response = DEFAULT_LIST_IMAGES[random(DEFAULT_LIST_IMAGES.length)]
    }

    return response;
}


function random(max) {
    var result = Math.floor(Math.random() * max);
    return result;
}


function getUrl(url) {
    var request = new XMLHttpRequest();
    request.open('GET', url, false);  // `false` faz o request ser syncrono.
    request.send(null);

    if (request.status === 200) {
        console.log(request.responseText);
    }

    return request.responseText;
}